import React from "react";
import Collapsible from "react-collapsible";

import "./ProjectItem.css";

const ProjectItem = props => {
  return (
    <Collapsible trigger={props.triggerTitle}>
      <a href={props.hrefLink} className="projectItem__wrapper">
        <img
          alt={props.triggerTitle}
          className="projectItem__img"
          src={props.img}
        />
        <p className="projectItem__paragraph">{props.children}</p>
      </a>
    </Collapsible>
  );
};

export default ProjectItem;
